import Link from "next/link";

const Header = () => {
  return (
    <div className="navbar-container">
      <div className="navbar-nav">
        <Link href="/">
          <a>Strona główna</a>
        </Link>
        <Link href="/katalog-spraw">
          <a>Załate sprawę</a>
        </Link>
        <Link href="/wnioski">
          <a>Wnioski</a>
        </Link>
        <Link href="/forum">
          <a>Forum</a>
        </Link>
      </div>
    </div>
  );
};

export default Header;
